import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css'

function Table(props) {

  return (
    <div className="">
       {
          props.getData.length>0?
          (
            props.getData.map(e=>              
                <div className="each-task" key={e._id}>  

                        {e.task}


                        {e.type}


                        {e.describe}

                        {e.time} 


                    <button id="remove" className="btn btn-info" onClick={(e)=>{
                      props.sinData(e);
                    }}
                    >Edit</button>

                    <div> 
                    <button id="remove" className="btn btn-danger">Delete</button>
                    </div> 

                </div>          
            )
          ) : 
          (
            <div>no data</div>
          )             
       }     
      </div>
  );
}

export default Table;
